import React from "react";
import data from "../timeline";
import timeList from "./TimelineList";

function Home() {
  const mydata = data.map((time) => (
    <div className="container">
      <h1>{time.year}</h1>
      <img width="200px" src={time.image} alt="event" />
      <p>{time.event}</p>
    </div>
  ));
  return <div>{mydata}</div>;
}

export default Home;
